vulner.how_to_fix:
Настройте ограничения доступа к устройству по протоколу SNMP с помощью следующих команд:
hostname(config)#access-list {snmp_access-list_number}permit {snmp_access-list} 
hostname(config)#access-list deny any log

Задайте пароль Enable с использованием стойкого алгоритма шифрования (Type 5):
hostname(config)#no enable password {пароль}
hostname(config)#enable secret {пароль}

Задайте пароль Enable с использованием стойкого алгоритма шифрования Type 5:
hostname(config)#no enable password {пароль}
hostname(config)#enable secret {пароль}

vulner.description:
В сетях ЛВС рекомендуется закрепить каждый узел за отдельным портом коммутатора.
Если это правило не соблюдается, возможно возникновение следующих ситуаций:
- пользователи закреплены за одним портом, но работают в разных отделах. В таком случае предполагается, что они должны находиться в разных сетях, что при текущей конфигурации сделать невозможно;
- возможен перехват трафика пользователей, закрепленных за одним портом коммутатора, где нет никаких механизмов защиты;
- в случае распространения вирусных атак может потребоваться отключение одного из портов от сети, что повлечет за собой потерю связи для нескольких пользователей.

vulner.how_to_fix:
При входе на устройство, используйте локальный или централизованный метод аутентификации:
hostname(config)#aaa new-model
hostname(config)#aaa authentication login { default | aaa_list_name } {local-case|group &lt;group-name&gt;}
hostname(config)#line {aux | console | tty | vty} { line-number } [ ending-line-number ] 
hostname(config-line)#login authentication { default | aaa_list_name }
